import {ORDER_URL} from '../../../services/UrlMapperService'

export const REQUEST_API_DATA = "REQUEST_HELLO_WORLD";
export const RECEIVE_API_DATA = "RECEIVE_HELLO_WORLD";

export const requestApiData = () => ({
  type: REQUEST_API_DATA,
  headers: {
    Accept: "application/json",
    "Content-Type": "application/json",
  },
});

export const getOrderDetailsAPI = () => {
    const postData = {
        type: REQUEST_API_DATA,
        headers: {
          Accept: "application/json",
          "Content-Type": "application/json",
        }
    }
    return HttpService.post(`${ORDER_URL}`, postData);
  };

  
export const receiveApiData = (data) => ({ type: RECEIVE_API_DATA, data });
